import React, { Component } from "react";
import Card from "../components/Card";
import projects from "./projects.json"


class Discover extends Component {
  state = {
projects
  };


  render() {
    return (
      <Row>
      <Col size="md-12">
        <h1>Welcome To Pupster!</h1>
      </Col>
    </Row>

    );
  }
}

export default Discover;
